<?phpnamespace Nemundo\WebLog\Com\ListBox;use Nemundo\Admin\Com\ListBox\AdminListBox;use Nemundo\Package\Bootstrap\FormElement\BootstrapListBox;use Nemundo\WebLog\Data\Domain\DomainReader;class DomainListBox extends AdminListBox{    public function getContent()    {        $this->label = 'Domain';        $reader = new DomainReader();        foreach ($reader->getData() as $domainRow) {            $this->addItem($domainRow->id, $domainRow->domain);        }        return parent::getContent();    }}